	private static char[][] toCharArray(String[] data) {
		System.out.println(data[0].length());
		char[][] ret = new char[data.length][data[0].length()];
		for (int i = 0; i < data.length; i++) {
			for (int j = 0; j < data[i].length(); j++) {
				ret[i][j] = data[i].charAt(j);
			}
		}
		return ret;
	}
